import React from 'react';
import Navbar from './../navbar/navbar';
import { Name, MenuBar, HalfSection, AboutBody,MenuBarBackground } from './../About/style';
import { ContactImg, ContactSection } from './style';
import linkedIn from './../../images/linkedIn.png';
import email from './../../images/email.png';

export default function Home() {
    return (
        <AboutBody>
            <MenuBarBackground>
            <MenuBar>
                <Name>Daniel</Name>
                <Navbar />
            </MenuBar>
            </MenuBarBackground>
            <HalfSection>
                <div>
                    <h1 style={{color: '#ff2a00'}}> Contact Me!</h1>
                </div>
            </HalfSection>
            <ContactSection>
                <ContactImg>
                    <img src={linkedIn} />
                </ContactImg>
                <ContactImg>
                    <img src={email} />
                </ContactImg>
            </ContactSection>
        </AboutBody>
        )
}
